import React from 'react';
import { Button, Modal } from 'react-bootstrap';
import {useSelector} from "react-redux";
import {RootState} from "../../store/reduxProvider";
interface props {
    visible : boolean,
    closeModal : ()=>void;
}

function ModalMarket(props:props) {
    const logged = useSelector((state: RootState)=>state.auth.auth.isLogged);

    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>


                <Modal scrollable={true} show={props.visible} animation={true}  onHide={props.closeModal} style={styled.container}>

                    <div style={{height: 30,textAlign: 'center'}}>
                        { logged?
                            <button>close</button>:
                            <button>Đăng nhập</button>

                        }
                    </div>
                </Modal>
            // </>
        // </div>
    );
}
const  styled={
    container:{height: 500,width: 430,marginLeft: 700,marginTop:60,borderRadius:10,alignContent: 'center'},
    buttonClose:{
        // height: 20,
        padding:10,
        borderRadius: 10,
        borderWidth: 1,
        borderColor: 'black'
    }
}
export default ModalMarket;
